import {signOut} from "firebase/auth";
import { auth } from '../firebase';

const Navbar = () => {
  return (
    <div className='navbar'>
      <span className="logo">
        Lama Chat
      </span>
      <div className="user">
        <img src="https://images.pexels.com/photos/15767253/pexels-photo-15767253.jpeg?auto=compress&cs=tinysrgb&w=1600&lazy=load" alt="" />
        <span>John</span>
        <button onClick={() => signOut(auth)}>Logout</button>
      </div>
    </div>
  )
}

export default Navbar
